import Header from "../../components/Header";
import ListDetail from "../../components/ListDetail";
import * as S from "./styles";

const attendants = [
  {
    fullname: "Fulano",
    username: "fulado.ciclano",
    password: 12345,
    event: "Scrum Day",
  },
  {
    fullname: "Fulano",
    username: "fulado.ciclano",
    password: 12345,
    event: "Scrum Day",
  },
  {
    fullname: "Fulano",
    username: "fulado.ciclano",
    password: 12345,
    event: "Scrum Day",
  },
];

function AttendantsList() {
  return (
    <>
      <Header type="admin" />
      <S.List>
        {attendants.map((attendant) => (
          <ListDetail obj={attendant} key={attendant.id} />
        ))}
      </S.List>
    </>
  );
}

export default AttendantsList;
